MathJax.Localization.addTranslation("ca","MathML",{version:"2.7.9",isLoaded:!0,strings:{BadMglyph:"Mglyph incorrecte: %1",BadMglyphFont:"Font incorrecta: %1",MathPlayer:`MathJax no ha pogut configurar MathPlayer.

Si MathPlayer no est\xE0 instal\xB7lat, necessiteu instal\xB7lar-lo pr\xE8viament. Altrament, pot ser que la vostra configuraci\xF3 de seguretat estigui blocant l'execuci\xF3 de controls ActiveX. Useu el men\xFA Opcions d'Internet dins el men\xFA Eines i seleccioneu la pestanya Seguretat, i llavors premeu el bot\xF3 Nivell Personalitzat. Assegureu-vos que les configuracions per 'Executar Controls ActiveX' i 'Comportaments binari i script' estan activades.

De moment veureu missatges d'error en comptes de f\xF3rmules matem\xE0tiques.`,CantCreateXMLParser:`MathJax no pot crear un analitzador XML per MathML. Comproveu que la configuraci\xF3 de seguretat 'Controls de script ActiveX marcats segurs per scripting' est\xE0 marcada (aneu a l'opci\xF3 Opcions d'Internet dins el men\xFA Eines, i seleccioneu el panell de Seguretat; despr\xE9s, cliqueu el bot\xF3 Nivell Personalitzat per activar aquesta configuraci\xF3).

Les equacions MathML no podran ser processades per MathJax`,UnknownNodeType:"Tipus de node desconegut: %1",UnexpectedTextNode:"Node de text inesperat: %1",ErrorParsingMathML:"Error d'an\xE0lisi MathML",ParsingError:"Error d'an\xE0lisi MathML: %1",MathMLSingleElement:"MathML ha d'estar format per un sol element",MathMLRootElement:"MathML ha d'estar format per un element <math>, no per %1"}}),MathJax.Ajax.loadComplete("[MathJax]/localization/ca/MathML.js");
